// react component that copies the given text inside your clipboard
// reactstrap components
import {
  Badge,
  Card,
  CardHeader,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  DropdownToggle,
  Media,
  Progress,
  Table,
  Container,
  Row,
  UncontrolledTooltip,
  CardBody,
  PaginationItem,
  PaginationLink,
  CardFooter,
  Pagination
} from "reactstrap";


import Header from "components/Headers/Header.jsx";

class Icons extends React.Component {
  state = {};
  render() {
    return (
      <div>
         <Header />
        <Container className=" mt--7" fluid>
          <Row>
            <div className=" col">
              <Card className=" shadow">
                <CardHeader className=" bg-transparent">
                  <h3 className=" mb-0">List File</h3>
                </CardHeader>

                galoooo
              </Card>
            </div>
            </Row>
        </Container>
      </div>
    );
  }
}

export default Icons;
